import React from 'react';
import Table from 'react-bootstrap/Table';
import Card from 'react-bootstrap/Card';
import Emoji from './Emoji';
import HistoryTab from './HistoryTab';
import AdminTab from './AdminTab';


let data = require('../data/downloadsevents.json');
console.log(data);

  // fetch('./downloadsevents.json')
  // .then(response => {
  //   console.log(response.json());
  //   //data = response.data;
  //   //return response.json();
  // })
  // .then(data => console.log(data));

const listDownloads = data.map((download) =>
  <tr key={download._id}>
    <td>{download._id}</td>
    <td>{download.socket}</td>
    <td>{download.songId}</td>
    <td>{download.downloadTime}</td>
  </tr>
);

  const DownloadsTable = () => {

  return(
  <div name="Downloads History Table" Style="margin: 7em;">
    <AdminTab />
    <HistoryTab selectProp="event" />
    <Card>
      <Card.Body>
        <h3 Style="text-align:left;"><Emoji symbol="ðŸŽ§"/> Downloads History Table</h3>
      </Card.Body>
    </Card>

    <Table striped bordered hover>
      <thead>
        <tr>
          <th>ID</th>
          <th>Socket</th>
          <th>Sond ID</th>
          <th>Download Time</th>
        </tr>
      </thead>
      <tbody>
        {listDownloads}
      </tbody>
    </Table>
  </div>
  );
}

export default DownloadsTable;
